public class StagingMethodTest {

    public static String getStringRepresentation(Meal[][] m) {
        String result = "";
        for (Meal[] m1 : m) {
            for (Meal m2 : m1) {
                result += m2.getNoOfEggs() + " ";
            }
            result += "\n";
        }
        return result;
    }

    public static Meal[][] makeEggMeals(String mealsToPrepare) {
		String[] arrR = mealsToPrepare.split("_");
		int numRows = arrR.length;
		String[] arrC= arrR[0].split(",");
		int numCol = arrC.length;

		String[][] arr = new String[numRows][numCol];
		for(int i=0; i<numRows; i++) {
			arr[i] = arrR[i].split(",");
		}

		Meal[][] output = new Meal[numRows][numCol];
		for(int i=0; i<numRows; i++) {
			for(int j=0; j<numCol; j++) {
				output[i][j] = new Meal(new Drink[2], Integer.parseInt(arr[i][j]));
			}
		}
        return output;
    }

	@TestCase
