		assertEquals("3,4_0,1_9,9_3,3_4,5_0,0", getStringRepresentation(makeEggMeals("3,4_0,1_9,9_3,3_4,5_0,0")), getStringRepresentation(MethodHolder.makeEggMeals("3,4_0,1_9,9_3,3_4,5_0,0")));
