    public static Drink[] loadDrinks(String fileName) throws FileNotFoundException {
		ArrayList<Drink> drinks = new ArrayList<>();

		File f = new File(fileName);
		Scanner sc = new Scanner(f).useDelimiter(",|\r\n|\n");

		while(sc.hasNext()) {
			char type = sc.next().charAt(0);
			int v = sc.nextInt();
			drinks.add(new Drink(v, type));
		}

		return drinks.toArray(new Drink[0]);
	}

    public static boolean checkEqual(Drink[] a1, Drink[] a2) {
        if (a1 == null || a2 == null) return false;
        if (a1.length != a2.length) return false;
        for (int i=0; i<a1.length; i++) {
            Drink d1 = a1[i];
            Drink d2 = a2[i];
            if (d1.getType() != d2.getType()) return false;
            if (d1.getVolume() != d2.getVolume()) return false;
        }
        return true;
    }

	@TestCase(expectedOutput="true")
	public void test0() throws Exception {
		assertEquals("Passed loadDrinks()", true, checkEqual(data, DrinkData.loadDrinks("data.csv")));
	}

	@TestCase
	public void test1() throws Exception {
		//expectThrowable MUST come before all other code within the method
		expectThrowable("Passed loadDrinks()\nFile cannot be found", new FileNotFoundException());
		//run code that is expected to throw the exception here
        DrinkData.loadDrinks("bad.csv");

	}

	@TestCase(expectedOutput="true")
	public void test2() throws Exception {
	    DrinkData.saveDrinks(data, "saved.csv");
		assertEquals("Passed saveDrinks()", true, checkEqual(loadDrinks("saved.csv"), data));
	}

	@TestCase(expectedOutput="true")
	public void test3() throws Exception {
	    data[0].consume(50);
	    Drink[] withoutConsumed = new Drink[8];
	    for (int i=1; i<data.length; i++) {
	        withoutConsumed[i-1] = data[i];
	    }
	    DrinkData.saveDrinks(data, "saved.csv");
		assertEquals("Passed saveDrinks()\nConsumed Drinks not saved", true, checkEqual(loadDrinks("saved.csv"), withoutConsumed));
	}
}

