	    Rectangle ans = new Rectangle(14,9,3,3);
		assertEquals("Rectangle[x=14,y=9,width=3,height=3] and Rectangle[x=14,y=9,width=3,height=3]", ans.toString(), MethodHolder.union(rectA, rectB).toString());
	}

}

