import static javaly.core.Test.*;
import javaly.core.*;
import java.text.*;
public class StagingMethodTest {

    @TestCase(expectedOutput="true")
	public void test0() throws Exception {
	   //Lion is instanceof Animal
	    Lion l = new Lion(1.57, 68.20, "SuperLion");

		assertEquals("Lion is an Animal", true, l instanceof Animal);
	}

	@TestCase(expectedOutput="true")
	public void test1() throws Exception {
	    //hunting is 50%
	    final double epsilon = 0.05;
	    final int trials = 10000;
	    final double predictedRate = 0.5;

	    int successCount = 0;

	    Lion l = new Lion(1.57, 68.20, "SuperLion");
	    Animal prey = new Animal(1.00, 30.00, "Poor Zebra");

	    for(int i = 0; i < trials; i++){
	        successCount = l.hunt(prey) ? ++successCount : successCount; 
	    }

	    double successRate = (double)successCount / trials;
	    boolean hasCorrectRate = successRate > predictedRate - epsilon && successRate < predictedRate + epsilon;

		assertEquals("50% chance of hunting", true, hasCorrectRate);
	}

	@TestCase(expectedOutput="false")
	public void test2() throws Exception {
	    //new Lions have no prey

	    Lion l = new Lion(1.57, 68.20, "SuperLion");

		assertEquals("no prey without hunting hasPrey()", false, l.hasPrey());
		assertEquals("no prey without hunting getPrey()", null, l.getPrey());
	}

	@TestCase(expectedOutput="false")
	public void test3() throws Exception {
	    //Lions who fail hunting should have no prey
	    boolean hasCorrectLion = false;
        Lion l = null;
        Animal prey = null;
        while(!hasCorrectLion){
	        l = new Lion(1.57, 68.20, "SuperLion");
            prey = new Animal(1.57, 68.20, "Chicken");
            hasCorrectLion = !l.hunt(prey);
        }

		assertEquals("no prey with failed hunt hasPrey()", false, l.hasPrey());
		assertEquals("no prey with failed hunt getPrey()", null, l.getPrey());
	}

	@TestCase(expectedOutput="true")
	public void test4() throws Exception {
	    //Lions who succeed in hunting should have correct prey
	    boolean hasCorrectLion = false;
        Lion l = null;
        Animal prey = null;

        while(!hasCorrectLion){
	        l = new Lion(1.57, 68.20, "SuperLion");
            prey = new Animal(1.57, 68.20, "Chicken");
            hasCorrectLion = l.hunt(prey);
        }

		assertEquals("prey with successful hunt hasPrey()", true, l.hasPrey());
		assertEquals("prey with successful hunt getPrey()", prey.toString(), l.getPrey().toString());
	}

	@TestCase(expectedOutput="I GOT NUTHIN TO EAT >:3")
	public void test5() throws Exception {
	    //testing eat output with no prey
        Lion l =  new Lion(1.57, 68.20, "SuperLion");
        l.eat();

		assertEquals("eat() with no prey", "I GOT NUTHIN TO EAT >:3", retrieveSystemOutput());
	}

	@TestCase(expectedOutput="AHHHHH... FRESH MEAT!")
	public void test6() throws Exception {
	    //testing eat output with  prey
	    boolean hasCorrectLion = false;
        Lion l = null;
        while(!hasCorrectLion){
	        l = new Lion(1.57, 68.20, "SuperLion");
            Animal prey = new Animal(1.57, 68.20, "SuperLion");
            hasCorrectLion = l.hunt(prey);
        }
        l.eat();

		assertEquals("eat() with prey", "AHHHHH... FRESH MEAT!", retrieveSystemOutput());
	}

	@TestCase(expectedOutput="Eating prey gains weight")
	public void test7() throws Exception {
	    //testing eat output with  prey
	    DecimalFormat twoDPFormat = new DecimalFormat("0.00");

	    boolean hasCorrectLion = false;
        Lion l = null;
        Animal prey = null;

        while(!hasCorrectLion){
	        l = new Lion(1.57, 68.20, "SuperLion");
            prey = new Animal(1.57, 30.00, "Chicken");
            hasCorrectLion = l.hunt(prey);
        }
        l.eat();
        retrieveSystemOutput();

		assertEquals("eat() with prey gains weight", twoDPFormat.format(68.20 + prey.getWeight()/3), twoDPFormat.format(l.getWeight()));
	}

	@TestCase(expectedOutput="Eating prey removes prey")
	public void test8() throws Exception {
	    //testing eat output with  prey
	    DecimalFormat twoDPFormat = new DecimalFormat("0.00");

	    boolean hasCorrectLion = false;
        Lion l = null;
        Animal prey = null;

        while(!hasCorrectLion){
	        l = new Lion(1.57, 68.20, "SuperLion");
            prey = new Animal(1.57, 30.00, "Chicken");
            hasCorrectLion = l.hunt(prey);
        }

        l.eat();
	    retrieveSystemOutput();

		assertEquals("eat() removes prey", true, l.getPrey() == null);
	}

}
